import React from 'react';
import './skills.css';

const Skills = () => {
  return (
    <div className="reshma__skills" id="skills">
      <div className="reshma__skills-content">
        <h1 className="reshma__skills-header">
          Skills
        </h1>
      </div>
    </div>
  )
}

export default Skills
